	it("should reject with sections-related query on rooms dataset - MAX", async function () {
		const result = facade.performQuery({
			WHERE: {
				IS: {
					rooms_instructor: "110",
				},
			},
			OPTIONS: {
				COLUMNS: ["sections_title", "overallAvg"],
			},
			TRANSFORMATIONS: {
				GROUP: ["sections_title"],
				APPLY: [
					{
						overallAvg: {
							MAX: "sections_lat",
						},
					},
				],
			},
		});
		return expect(result).to.eventually.be.rejectedWith(InsightError);
	});


